import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { jwtDecode } from 'jwt-decode'; // Corrected import
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [credentials, setCredentials] = useState({ username: '', password: '' });
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    // Redirect if already logged in
    if (sessionStorage.getItem('access_token')) {
      const user = jwtDecode(sessionStorage.getItem('access_token'));
      navigate(user.user_type === 'admin' ? '/admin/dashboard' : '/user/dashboard');
    }
  }, [navigate]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCredentials({ ...credentials, [name]: value });
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    const endpoint = 'http://localhost:8000/api/login/';
    
    console.log("Login Credentials:", credentials); // Add this line for debugging
  
    try {
      const response = await axios.post(endpoint, credentials, {
        headers: { 'Content-Type': 'application/json' },
      });
  
      const { access, refresh } = response.data;
  
      // Store tokens and handle user type
      sessionStorage.setItem('access_token', access);
      sessionStorage.setItem('refresh_token', refresh);
      
      const token = response.data.token;
      console.log(token)  // Assuming you're using token authentication
        const userTypeResponse = await axios.get('http://localhost:8000/api/get-user-type/', {
            headers: {
                'Authorization': `Bearer ${token}`
            }
        });

        const userType = userTypeResponse.data.user_type;

      axios.defaults.headers.common['Authorization'] = `Bearer ${access}`;
  
      if (isAdmin || userType === 'admin') {
        navigate('/admin/dashboard');
      } else {
        navigate('/user/dashboard');
      }
    } catch (error) {
      console.error("Login Error:", error); // Log the entire error object
      if (error.response) {
        console.log("Response data:", error.response.data); // Log response data
        console.log("Response status:", error.response.status); // Log response status
        if (error.response.status === 400) {
          setError('Invalid username or password.');
        } else if (error.response.status === 401) {
          setError('Unauthorized. Please check your credentials.');
        } else {
          setError('Login failed. Please try again.');
        }
      } else if (error.request) {
        setError('No response from the server. Please check your network connection.');
      } else {
        setError('An unknown error occurred.');
      }
    }
  };
    

  const styles = {
    container: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      height: '100vh',
      backgroundColor: '#f4f4f4',
    },
    form: {
      background: '#fff',
      padding: '20px',
      borderRadius: '5px',
      boxShadow: '0 2px 5px rgba(0,0,0,0.2)',
      width: '300px',
      textAlign: 'center',
    },
    label: {
      display: 'block',
      marginBottom: '8px',
      fontWeight: 'bold',
    },
    input: {
      width: '100%',
      padding: '10px',
      marginBottom: '15px',
      border: '1px solid #ccc',
      borderRadius: '4px',
    },
    button: {
      width: '100%',
      padding: '10px',
      backgroundColor: '#007BFF',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    switchButton: {
      marginTop: '10px',
      padding: '10px',
      backgroundColor: '#6c757d',
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
      fontWeight: 'bold',
    },
    error: {
      color: 'red',
      marginTop: '10px',
    },
  };

  return (
    <div style={styles.container}>
      <h2>{isAdmin ? 'Admin Login' : 'User Login'}</h2>
      <form style={styles.form} onSubmit={handleLogin}>
        <div>
          <label style={styles.label}>
            Username:
            <input
              type="text"
              name="username"
              value={credentials.username}
              onChange={handleInputChange}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Password:
            <input
              type="password"
              name="password"
              value={credentials.password}
              onChange={handleInputChange}
              required
              style={styles.input}
            />
          </label>
        </div>
        <button type="submit" style={styles.button}>Login</button>
      </form>
      <button style={styles.switchButton} onClick={() => setIsAdmin(!isAdmin)}>
        Switch to {isAdmin ? 'User' : 'Admin'} Login
      </button>
      {error && <div style={styles.error}>{error}</div>}
    </div>
  );
};

export default Login;
